import React from 'react'
import {connect} from 'react-redux'
import {submitVoucher} from '../../reducers/purchase'
import {Button} from 'antd'
import withStyles from 'isomorphic-style-loader/lib/withStyles'
import s from './Voucher.css'
import {Actions, SectionHeader} from '../../components'
import KeyHandler, {KEYPRESS} from 'react-key-handler'
import messages from './messages'

const voucherTemplate = 'data:image/png;base64,'

const voucherStyles = {
  background: {
    width: 400,
    height: 580,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    position: 'relative',
  },
  input: {
    color: '#404D5F',
    fontSize: '15px',
    lineHeight: '32px',
    fontFamily: 'Proxima Nova',
    outline: 'none'
  },
  receiver: {
    position: 'absolute',
    top: 187,
    left: 35 + 8,
    right: 30 + 8,
  },
  giver: {
    position: 'absolute',
    top: 272,
    left: 35 + 8,
    right: 30 + 8,
  },
  body: {
    position: 'absolute',
    top: 357,
    left: 35 + 8,
    right: 30 + 8,
  }
}

// TODO add recipient/receiver fields as dropdowns
class Voucher extends React.Component {
  handleSubmit = () => {
    this.props.submitVoucher({voucher: this.voucher.outerHTML})
  }

  render() {
    const {intl, flowIndex, loading} = this.props

    return (
      <React.Fragment>
        <div className={s.content}>
          <SectionHeader
            className={s.header}
            header={intl.formatMessage(messages.header)}
            number={flowIndex + 1}
            prefixClassName={s.headerPrefix}
          />
          <p className={s.description}>{intl.formatMessage(messages.description)}</p>
          <div className={s.voucherWrapper}>
            <div style={{backgroundImage: `url(${voucherTemplate})`, ...voucherStyles.background}} ref={ref => this.voucher = ref}>
              <style>{'.voucherBody > div {margin-top: 3px;}'}</style>
              <div contentEditable={true} style={{...voucherStyles.receiver, ...voucherStyles.input}}/>
              <div contentEditable={true} style={{...voucherStyles.giver, ...voucherStyles.input}}/>
              <div contentEditable={true} style={{...voucherStyles.body, ...voucherStyles.input}} className={'voucherBody'}/>
            </div>
          </div>
        </div>
        <Actions>
          <KeyHandler
            keyEventName={KEYPRESS}
            keyCode={13}
            onKeyHandle={this.handleSubmit}
          />
          <Button
            type='primary'
            onClick={this.handleSubmit}
          >
            {intl.formatMessage(messages.submit)}
          </Button>
        </Actions>
      </React.Fragment>
    )
  }
}

const mapState = state => ({
  loading: state.purchase.loading,
  flowIndex: state.purchase.flowIndex,
})

const mapDispatch = {
  submitVoucher,
}

export default connect(mapState, mapDispatch)(withStyles(s)(Voucher))
